import React from "react";
import {Link} from 'react-router-dom';

const Footer = () => {
    return (
        <div className="container-fluid bg-warning">
            <div className="footer row">
                <div className="col-sm-10 mx-auto text-center">
                    <div className="jumbotron rounded-0 bg-warning text-light">
                        <p className="lead text-dark">Join the class social group</p>
                        <div>
                            <Link className="text-center mx-2" to="https://wwww.facebook.com/oyeleke.oluwasayo">
                                <i class="rounded bg-dark text-primary fa fa-facebook fa-2x"></i>
                            </Link>
                            <Link className="text-center mx-2" to="https://web.whatsapp.com">
                                <i class="rounded bg-dark text-success fa fa-whatsapp fa-2x"></i>
                            </Link>
                            <Link className="text-center mx-2" to="www.telegram.com">
                                <i class="rounded bg-dark text-info fa fa-telegram fa-2x"></i>
                            </Link>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Footer;
